import React from "react";
import Navbar from "../components/Navbar/Navbar";
import styled from "styled-components";
import classes from "./Cart.module.css";

const Container = styled.div``;

const Image = styled.img`
  width: 141px;
  height: 185px;
`;

const Wrapper = styled.div`
  margin: 120px;
  width: 75%;
  background-color: gray;
`;

const Smth = styled.div`
  font-family: "Raleway";
  font-style: normal;
  font-weight: 400;
  font-size: 30px;
  line-height: 27px;
`;

const Quantity = styled.div`
  text-align: center;
`;

const Title = styled.div`
  font-family: "Raleway";
  font-style: normal;
  font-weight: 600;
  font-size: 30px;
  line-height: 27px;
`;

const Buttons = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: space-between;
`;

const LeftWrp = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: space-between;
`;

const Left = styled.div`
  float: left;
  display: flex;
  justify-content: flex-start;
`;

const Right = styled.div`
  display: flex;
  justify-content: flex-end;
`;

function Cart() {
  return (
    <Container>
      <Navbar />
      <Wrapper>
        <Left>
          <LeftWrp>
            <Title>Apollo</Title>
            <Smth>Apollo</Smth>
          </LeftWrp>
        </Left>
        <Right>
          <Buttons>
            <button type="submit" className={classes.btn__plus}>
              +
            </button>
            <Quantity>1</Quantity>
            <button type="submit" className={classes.btn__plus}>
              -
            </button>
          </Buttons>
          <Image src="https://fakestoreapi.com/img/81fPKd-2AYL._AC_SL1500_.jpg" />
        </Right>
      </Wrapper>
    </Container>
  );
}
export default Cart;
